import React from 'react';
import './App.css';
import { Icon, Header, Segment } from 'semantic-ui-react'

function App() {
  return (
    <React.Fragment>
      <Header as='h1'>Guligena Aierken</Header>
      <div>
          <Icon loading name='spinner' />
          <Icon loading name='certificate' />
          <Icon loading name='asterisk' />
     </div>


    </React.Fragment>
  );
}

export default App;
